$$;

CREATE FUNCTION public.copy_level(_levelid bigint, _newowner bigint, _setlocationcategory bigint) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
   newlevelid int8;
   oldeventid int8;
   neweventid int8;
   oldcharactercontrollerid int8;
   newcharactercontrollerid int8;
   charid int8;
   idlist int8[];
   aidlist int8[];
   rn int8;
BEGIN
   INSERT INTO "Level" (
     "GroupId", "OriginalGroupId", "CreatedTime", "ModifiedTime", "LevelTemplateId", "VerticalCategoryId", "LanguageId"
   ) SELECT
     _newowner, "OriginalGroupId", "CreatedTime", "ModifiedTime", "LevelTemplateId", "VerticalCategoryId", "LanguageId"
  FROM "Level" WHERE "Id"=_levelid
  RETURNING "Id" INTO newlevelid;
  RAISE NOTICE 'LevelId: %', newlevelid;

  FOR oldeventid IN SELECT "Id" FROM "Event" WHERE "LevelId" = _levelid ORDER BY "Id" LOOP
    INSERT INTO "Event" (
      "GroupId", "CreatedTime", "ModifiedTime", "LevelId", "LevelSequence", "AutoclipId"
    ) SELECT
      _newowner, "CreatedTime", "ModifiedTime", newlevelid, "LevelSequence", "AutoclipId"
    FROM "Event" WHERE "Id" = oldeventid
    RETURNING "Id" INTO neweventid;
    RAISE NOTICE 'EventId: %', neweventid;

    SELECT array_agg("Id" ORDER BY random()) FROM "Character" WHERE "GroupId" = _newowner INTO idlist;

    FOR oldcharactercontrollerid, rn IN SELECT "Id", row_number() OVER () FROM "CharacterController" WHERE "EventId"=oldeventid LOOP
        INSERT INTO "CharacterController" (
           "EventId", "ControllerSequenceNumber", "CharacterId", "CharacterSpawnPositionFormationId", "CharacterSpawnPositionIndex", "ActivationCue", "EndCue"
        )
        SELECT neweventid, "ControllerSequenceNumber", idlist[(rn % array_length(idlist, 1))+1], "CharacterSpawnPositionFormationId", "CharacterSpawnPositionIndex", "ActivationCue", "EndCue" FROM "CharacterController" WHERE "Id"=oldcharactercontrollerid
        RETURNING "Id", "CharacterId" INTO newcharactercontrollerid, charid;
        RAISE NOTICE 'Character Controller: %', newcharactercontrollerid;

        SELECT array_agg("Id" ORDER BY random()) FROM "BodyAnimation" INNER JOIN "SetLocationCategoryAndBodyAnimationCategory" ON "BodyAnimation"."BodyAnimationCategoryId"="SetLocationCategoryAndBodyAnimationCategory"."BodyAnimationCategoryId" WHERE "SetLocationCategoryId"=_setlocationcategory  INTO aidlist;

        INSERT INTO "CharacterControllerBodyAnimation" (
            "CharacterControllerId", "ControllerSequenceNumber", "PrimaryBodyAnimationId", "LowerBodyAnimationId", "AnimationSpeed", "ActivationCue", "EndCue", "Locomotion", "Looping"
        )
        SELECT newcharactercontrollerid, "ControllerSequenceNumber", aidlist[("ControllerSequenceNumber" % array_length(aidlist, 1)) +1], "LowerBodyAnimationId", "AnimationSpeed", "ActivationCue", "EndCue", "Locomotion", "Looping"        FROM "CharacterControllerBodyAnimation" WHERE "CharacterControllerId" = oldcharactercontrollerid;

        SELECT array_agg("UmaRecipeId" ORDER BY random()) FROM "CharacterAndUmaRecipe" WHERE "CharacterId" = charid INTO aidlist;

        INSERT INTO "CharacterControllerUmaRecipe" ("CharacterControllerId", "ControllerSequenceNumber", "UmaRecipeId", "ActivationCue", "EndCue")
        SELECT newcharactercontrollerid, "ControllerSequenceNumber", aidlist[("ControllerSequenceNumber" % array_length(aidlist, 1)) +1], "ActivationCue", "EndCue"
        FROM "CharacterControllerUmaRecipe" WHERE "CharacterControllerId" = oldcharactercontrollerid;

        INSERT INTO "CharacterControllerFaceVoice" ("CharacterControllerId",
               "ControllerSequenceNumber", "VoiceTrackId", "FaceAnimationId", "VoiceFilterId", "ActivationCue", "EndCue", "ExtremeExpressionId", "FaceVfxId"
        )
        SELECT newcharactercontrollerid,
               "ControllerSequenceNumber", "VoiceTrackId", "FaceAnimationId", "VoiceFilterId", "ActivationCue", "EndCue", "ExtremeExpressionId", "FaceVfxId"
        FROM "CharacterControllerFaceVoice" WHERE "CharacterControllerId" = oldcharactercontrollerid;
    END LOOP;

    SELECT array_agg("Id" ORDER BY random()) FROM "SetLocation" WHERE "SetLocationCategoryId" = _setlocationcategory INTO aidlist;

    INSERT INTO "SetLocationController" ("EventId", "ControllerSequenceNumber", "SetLocationAssetId", "ActivationCue", "EndCue", "TimeOfDayId", "WeatherId")
    SELECT neweventid, "ControllerSequenceNumber", aidlist[("ControllerSequenceNumber" % array_length(aidlist, 1))+1], "ActivationCue", "EndCue", "TimeOfDayId", "WeatherId"
    FROM "SetLocationController" WHERE "EventId" = oldeventid;

    SELECT array_agg("Id" ORDER BY random()) FROM "Vfx" INNER JOIN "SetLocationCategoryAndVfxCategory" ON "Vfx"."VfxCategoryId"="SetLocationCategoryAndVfxCategory"."VfxCategoryId" WHERE "SetLocationCategoryId"=_setlocationcategory INTO aidlist;
    INSERT INTO "VfxController" ("EventId", "ControllerSequenceNumber", "VfxAssetId", "AnimationSpeed", "ActivationCue", "EndCue", "Looping")
    SELECT neweventid, "ControllerSequenceNumber", aidlist[("ControllerSequenceNumber" % array_length(aidlist, 1))+1], "AnimationSpeed", "ActivationCue", "EndCue", "Looping"
    FROM "VfxController" WHERE "EventId" = oldeventid;

    INSERT INTO "CameraController" ("EventId",
           "ControllerSequenceNumber", "ActivationCue", "EndCue", "CameraAnimationId", "CameraAnimationTemplateId", "SpawnIndex",
           "StartDepthOfFieldOffset", "EndDepthOfFieldOffset",
	   "StartFocusDistance", "EndFocusDistance", "FollowSpawnPositionIndex", "FollowAll", "LookAtIndex", "CameraNoiseSettingsIndex", "AutoFocus", "AutoRoll", "FollowZoom"
    )
    SELECT neweventid,
           "ControllerSequenceNumber", "ActivationCue", "EndCue", "CameraAnimationId", "CameraAnimationTemplateId", "SpawnIndex",
           "StartDepthOfFieldOffset", "EndDepthOfFieldOffset",
           "StartFocusDistance", "EndFocusDistance", "FollowSpawnPositionIndex", "FollowAll", "LookAtIndex", "CameraNoiseSettingsIndex", "AutoFocus", "AutoRoll", "FollowZoom"
    FROM "CameraController" WHERE "EventId" = oldeventid;

    INSERT INTO "MusicController" ("EventId",
           "ControllerSequenceNumber", "SongAssetId", "ScoreAssetId", "UserSoundId", "ActivationCue", "EndCue", "VoiceSoundVolume", "LevelSoundVolume")
    SELECT neweventid,
           "ControllerSequenceNumber", "SongAssetId", "ScoreAssetId", "UserSoundId", "ActivationCue", "EndCue", "VoiceSoundVolume", "LevelSoundVolume"
    FROM "MusicController" WHERE "EventId" = oldeventid;

  END LOOP;
END;
$$;

CREATE FUNCTION public.copy_level_genre(_levelid bigint, _newowner bigint, _genre bigint, _camerafovfactor double precision DEFAULT 1, _cameraorbitfactor double precision DEFAULT 1) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
   newlevelid int8;
   oldeventid int8;
   neweventid int8;
   oldcharactercontrollerid int8;
   newcharactercontrollerid int8;
   charid int8;
   idlist int8[];
