            "CharacterControllerId", "ControllerSequenceNumber", "PrimaryBodyAnimationId", "LowerBodyAnimationId", "AnimationSpeed", "ActivationCue", "EndCue", "Locomotion", "Looping"
        )
        SELECT newcharactercontrollerid, "ControllerSequenceNumber", aidlist[("ControllerSequenceNumber" % array_length(aidlist, 1)) +1], "LowerBodyAnimationId", "AnimationSpeed", "ActivationCue", "EndCue", "Locomotion", "Looping"        FROM "CharacterControllerBodyAnimation" WHERE "CharacterControllerId" = oldcharactercontrollerid;

        SELECT array_agg("UmaRecipeId" ORDER BY random()) FROM "CharacterAndUmaRecipe" WHERE "CharacterId" = charid INTO aidlist;

        INSERT INTO "CharacterControllerUmaRecipe" ("CharacterControllerId", "ControllerSequenceNumber", "UmaRecipeId", "ActivationCue", "EndCue")
        SELECT newcharactercontrollerid, "ControllerSequenceNumber", aidlist[("ControllerSequenceNumber" % array_length(aidlist, 1)) +1], "ActivationCue", "EndCue"
        FROM "CharacterControllerUmaRecipe" WHERE "CharacterControllerId" = oldcharactercontrollerid;

        INSERT INTO "CharacterControllerFaceVoice" ("CharacterControllerId",
               "ControllerSequenceNumber", "VoiceTrackId", "FaceAnimationId", "VoiceFilterId", "ActivationCue", "EndCue", "ExtremeExpressionId", "FaceVfxId"
        )
        SELECT newcharactercontrollerid,
               "ControllerSequenceNumber", "VoiceTrackId", "FaceAnimationId", "VoiceFilterId", "ActivationCue", "EndCue", "ExtremeExpressionId", "FaceVfxId"
        FROM "CharacterControllerFaceVoice" WHERE "CharacterControllerId" = oldcharactercontrollerid;
    END LOOP;

    SELECT array_agg("Id" ORDER BY random()) FROM "SetLocation" WHERE "SetLocationMoodId" = _setlocationmood INTO aidlist;

    INSERT INTO "SetLocationController" ("EventId", "ControllerSequenceNumber", "SetLocationAssetId", "ActivationCue", "EndCue", "TimeOfDayId", "WeatherId")
    SELECT neweventid, "ControllerSequenceNumber", aidlist[("ControllerSequenceNumber" % array_length(aidlist, 1))+1], "ActivationCue", "EndCue", "TimeOfDayId", "WeatherId"
    FROM "SetLocationController" WHERE "EventId" = oldeventid;

    SELECT array_agg("Id" ORDER BY random()) FROM "Vfx" INNER JOIN "SetLocationMoodAndVfxCategory" ON "Vfx"."VfxCategoryId"="SetLocationMoodAndVfxCategory"."VfxCategoryId" WHERE "SetLocationMoodId"=_setlocationmood INTO aidlist;
    INSERT INTO "VfxController" ("EventId", "ControllerSequenceNumber", "VfxAssetId", "AnimationSpeed", "ActivationCue", "EndCue", "Looping")
    SELECT neweventid, "ControllerSequenceNumber", aidlist[("ControllerSequenceNumber" % array_length(aidlist, 1))+1], "AnimationSpeed", "ActivationCue", "EndCue", "Looping"
    FROM "VfxController" WHERE "EventId" = oldeventid;

    INSERT INTO "CameraController" ("EventId",
           "ControllerSequenceNumber", "ActivationCue", "EndCue", "CameraId", "SpawnIndex",
           "StartFOV", "EndFOV",
           "StartDepthOfFieldOffset", "EndDepthOfFieldOffset", "StartXAxis", "StartYAxis",
           "StartOrbitLatitude", "StartOrbitLongitude",
           "EndXAxis", "EndYAxis",
           "EndOrbitLatitude", "EndOrbitLongitude",
           "StartAnimationSpeed", "EndAnimationSpeed", "StartDutch", "EndDutch", "StartFocusDistance", "EndFocusDistance", "FollowSpawnPositionIndex", "FollowAll", "LookAtIndex", "CameraNoiseSettingsIndex", "AutoFocus", "AutoRoll", "FollowZoom"
    )
    SELECT neweventid,
           "ControllerSequenceNumber", "ActivationCue", "EndCue", "CameraId", "SpawnIndex",
           "StartFOV" * _camerafovfactor, "EndFOV" * _camerafovfactor,
           "StartDepthOfFieldOffset", "EndDepthOfFieldOffset", "StartXAxis", "StartYAxis",
           "StartOrbitLatitude", "StartOrbitLongitude",
           "EndXAxis" * _cameraorbitfactor, "EndYAxis" * _cameraorbitfactor,
           "EndOrbitLatitude" * _cameraorbitfactor, "EndOrbitLongitude" * _cameraorbitfactor,
           "StartAnimationSpeed", "EndAnimationSpeed", "StartDutch", "EndDutch", "StartFocusDistance", "EndFocusDistance", "FollowSpawnPositionIndex", "FollowAll", "LookAtIndex", "CameraNoiseSettingsIndex", "AutoFocus", "AutoRoll", "FollowZoom"
    FROM "CameraController" WHERE "EventId" = oldeventid;

    INSERT INTO "MusicController" ("EventId",
           "ControllerSequenceNumber", "SongAssetId", "ScoreAssetId", "UserSoundId", "ActivationCue", "EndCue", "VoiceSoundVolume", "LevelSoundVolume")
    SELECT neweventid,
           "ControllerSequenceNumber", "SongAssetId", "ScoreAssetId", "UserSoundId", "ActivationCue", "EndCue", "VoiceSoundVolume", "LevelSoundVolume"
    FROM "MusicController" WHERE "EventId" = oldeventid;

  END LOOP;
END;
$$;

CREATE FUNCTION public.exec(text) RETURNS text
    LANGUAGE plpgsql
    AS $_$ BEGIN EXECUTE $1; RETURN $1; END; $_$;

CREATE PROCEDURE public.finish_battles()
    LANGUAGE plpgsql
    AS $$
BEGIN
        IF EXISTS (SELECT 1 WHERE current_setting('transaction_isolation') != 'repeatable read') THEN
           RAISE EXCEPTION 'Must run in REPEATABLE READ!';
        END IF;

        WITH t AS (
                INSERT INTO "FinishedBattles" ("VideoId", "VideoIdLeft", "VideoIdRight", "VideoLeftVotes", "VideoRightVotes", "EndTime")
                SELECT "Video"."Id",
                       "BattleVideoLeftId",
                       "BattleVideoRightId",
                       COALESCE(COUNT(*) FILTER (WHERE "VoteForLeft"), 0),
                       COALESCE(COUNT(*) FILTER (WHERE NOT "VoteForLeft"), 0),
                       "EndTime"
                FROM "ActiveBattles"
                INNER JOIN "Video" ON "ActiveBattles"."VideoId" = "Video"."Id"
                LEFT JOIN "BattleVotes" ON "ActiveBattles"."VideoId" = "BattleVotes"."VideoId"
                WHERE "EndTime" < CURRENT_TIMESTAMP
                GROUP BY "Video"."Id", "ActiveBattles"."VideoId"
                RETURNING "VideoId"
        )
        DELETE FROM "ActiveBattles" WHERE "VideoId" IN (SELECT "VideoId" FROM t);
END
$$;

CREATE PROCEDURE public.refreshstartpackmembers()
    LANGUAGE plpgsql
    AS $$

BEGIN

    UPDATE "SetLocation"
    SET "IsStartPackMember" = false
    where "IsStartPackMember" = true;

    UPDATE "SetLocation"
    SET "IsStartPackMember" = true
    where "ReadinessId" = 2 and "SetLocationBundleId" in
          (select "Id"
           from (
                    select "Id",
                           "SizeKb",
                           sum("SizeKb") over (order by "SizeKb" desc) as total_size
                    from "SetLocationBundle"
                ) t
           where total_size <= 500000);

    UPDATE "Wardrobe"
    SET "IsStartPackMember" = false
    where "IsStartPackMember" = true and  "ReadinessId" != 2;

    UPDATE "Wardrobe"
    SET "IsStartPackMember" = true
    where "IsStartPackMember" = false and "ReadinessId" = 2;

END
$$;

CREATE FUNCTION public.update_birthday_day() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    NEW."BirthDate" = (date_trunc('month', NEW."BirthDate") + INTERVAL '1 month - 1 day')::DATE;

    RETURN NEW;
END

$$;

CREATE FUNCTION public.update_camera_animation_template_id() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    IF NEW."CameraAnimationTemplateId" IS NULL OR NEW."CameraAnimationTemplateId" = 0 THEN
SELECT "CameraAnimationTemplateId"
INTO NEW."CameraAnimationTemplateId"
FROM "CameraController"
WHERE "CameraAnimationId" = NEW."Id";

RETURN NEW;
END IF;

RETURN NEW;
END;
$$;

CREATE PROCEDURE public.update_creator_score_rank()
    LANGUAGE sql
    AS $$

update "Group"
set "CreatorRank" = null;

update "Group"
set "CreatorRank" = t.rank
from (select "Id", "CreatorScore", "CreatorRank", row_number() over (order by "CreatorScore" desc) rank
      from "Group"
      where "CreatorScore" <> 0
      order by "CreatorScore" desc
      limit 1000) t
where "Group"."Id" = t."Id";

$$;

CREATE FUNCTION public.vfxpositiongroupandvfxspawnposition_checkinthesamesetlocationbu() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    Group_SetLocationBundleId int8;
    Position_SetLocationBundleId int8;
BEGIN
    select
           sl."SetLocationBundleId" into Group_SetLocationBundleId
    from
        "VfxPositionGroup" g inner join
            "SetLocation" sl on g."SetLocationId" = sl."Id"
    where
        g."Id" = NEW."VfxPositionGroupId";

    select
           p."SetLocationBundleId" into Position_SetLocationBundleId
    from
        "VfxSpawnPosition" p
    where
          p."Id" = NEW."VfxSpawnPositionId";

    RAISE NOTICE 'Updating VfxPositionGroupAndVfxSpawnPosition VfxPositionGroup SLB = [id:%] SpawnPosition SLB = [id:%] ',
        Position_SetLocationBundleId, Group_SetLocationBundleId;

    IF (Group_SetLocationBundleId <> Position_SetLocationBundleId)
    THEN
        RAISE EXCEPTION 'VfxSpawnPosition [id:%] and VfxPositionGroup [id:%] belongs to different SetLocationBundle',
            NEW."VfxSpawnPositionId",
            NEW."VfxPositionGroupId";
    END IF;

    RETURN NEW;
END;
$$;

CREATE FUNCTION public.wardrobe_display_name() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    IF NEW."DisplayName" IS NULL
        THEN NEW."DisplayName" := NEW."Name";
    END IF;

    RETURN NEW;
END
$$;

CREATE PROCEDURE rollup.rollup()
    LANGUAGE plpgsql
    AS $$
DECLARE
    start_time  timestamptz;
    rollup_time timestamptz;
BEGIN
    IF EXISTS(SELECT 1 WHERE current_setting('transaction_isolation') != 'repeatable read') THEN
        RAISE EXCEPTION 'Must run in REPEATABLE READ!';
    END IF;

    rollup_time := CURRENT_TIMESTAMP;
    SELECT t INTO STRICT start_time FROM rollup.synctime;

    WITH likes AS (
        SELECT "VideoId", count(*) AS "num"
        FROM "Likes"
        WHERE "Time" >= start_time
          AND "Time" < rollup_time
        GROUP BY "VideoId"
    ),
         views AS (
             SELECT "VideoId", count(*) AS "num"
             FROM "Views"
             WHERE "Time" >= start_time
               AND "Time" < rollup_time
             GROUP BY "VideoId"
         ),
         comments AS (
             SELECT "VideoId", count(*) AS "num"
             FROM "Comments"
             WHERE "Time" >= start_time
               AND "Time" < rollup_time
             GROUP BY "VideoId"
         ),
         shares AS (
             SELECT "VideoId", count(*) AS "num"
             FROM "Shares"
             WHERE "Time" >= start_time
               AND "Time" < rollup_time
             GROUP BY "VideoId"
         ),
         remixes AS (
             SELECT "VideoId", count(*) AS "num"
             FROM "Remixes"
             WHERE "Time" >= start_time
               AND "Time" < rollup_time
             GROUP BY "VideoId"
         ),
         battles AS (
             SELECT "VideoId", sum(won) AS won, sum(lost) AS lost
             FROM (
                      SELECT "VideoIdLeft"                                                AS "VideoId",
                             count(*) FILTER (WHERE "VideoLeftVotes" > "VideoRightVotes") AS won,
                             count(*) FILTER (WHERE "VideoRightVotes" > "VideoLeftVotes") AS lost
                      FROM "FinishedBattles"
                      WHERE "EndTime" > start_time
                        AND "EndTime" < rollup_time
                      GROUP BY "VideoIdLeft"
                      UNION ALL
                      SELECT "VideoIdRight"                                               AS "VideoId",
                             count(*) FILTER (WHERE "VideoLeftVotes" < "VideoRightVotes") AS won,
                             count(*) FILTER (WHERE "VideoRightVotes" < "VideoLeftVotes") AS lost
                      FROM "FinishedBattles"
                      WHERE "EndTime" > start_time
                        AND "EndTime" < rollup_time
                      GROUP BY "VideoIdRight"
                  ) gg
             GROUP BY "VideoId"
         )
    INSERT
    INTO rollup."VideoRollup"
    ("VideoId", "Likes", "Views", "Comments", "Shares", "Remixes", "BattlesWon", "BattlesLost")
    SELECT "Video"."Id" as "VideoId",
           COALESCE(likes.num, 0),
           COALESCE(views.num, 0),
           COALESCE(comments.num, 0),
           COALESCE(shares.num, 0),
           COALESCE(remixes.num, 0),
           COALESCE(battles.won, 0),
           COALESCE(battles.lost, 0)
    FROM "Video"
             FULL OUTER JOIN likes on "Video"."Id" = likes."VideoId"
             FULL OUTER JOIN views ON "Video"."Id" = views."VideoId"
             FULL OUTER JOIN comments ON "Video"."Id" = comments."VideoId"
             FULL OUTER JOIN shares ON "Video"."Id" = shares."VideoId"
             FULL OUTER JOIN remixes ON "Video"."Id" = remixes."VideoId"
             FULL OUTER JOIN battles ON "Video"."Id" = battles."VideoId"
    ON CONFLICT ("VideoId") DO UPDATE SET "Likes"="VideoRollup"."Likes" + EXCLUDED."Likes",
                                          "Views"="VideoRollup"."Views" + EXCLUDED."Views",
                                          "Comments"="VideoRollup"."Comments" + EXCLUDED."Comments",
                                          "Shares"="VideoRollup"."Shares" + EXCLUDED."Shares",
                                          "Remixes"="VideoRollup"."Remixes" + EXCLUDED."Remixes",
                                          "BattlesWon"="VideoRollup"."BattlesWon" + EXCLUDED."BattlesWon",
                                          "BattlesLost"="VideoRollup"."BattlesLost" + EXCLUDED."BattlesLost";
    UPDATE rollup.synctime SET t=rollup_time;
END
$$;

