CREATE MATERIALIZED VIEW public."FollowerStats" AS
 SELECT g."Id" AS "GroupId",
    ( SELECT (count(*))::integer AS count
           FROM (public."Follower" f0
             JOIN public."Group" g0 ON ((f0."FollowingId" = g0."Id")))
          WHERE ((g."Id" = f0."FollowerId") AND ((NOT g0."IsBlocked") AND (g0."DeletedAt" IS NULL)))) AS "FollowingCount",
    ( SELECT (count(*))::integer AS count
           FROM (public."Follower" f1
             JOIN public."Group" g1 ON ((f1."FollowerId" = g1."Id")))
          WHERE ((g."Id" = f1."FollowingId") AND ((NOT g1."IsBlocked") AND (g1."DeletedAt" IS NULL)))) AS "FollowersCount",
    ( SELECT (count(*))::integer AS count
           FROM (public."Follower" f2
             JOIN public."Group" g2 ON ((f2."FollowerId" = g2."Id")))
          WHERE ((g."Id" = f2."FollowingId") AND f2."IsMutual" AND ((NOT g2."IsBlocked") AND (g2."DeletedAt" IS NULL)))) AS "FriendsCount"
   FROM public."Group" g
  WITH NO DATA;

