CREATE MATERIALIZED VIEW public."TemplateStats" AS
 WITH template_at_level AS (
         SELECT "Event"."LevelId",
            "Event"."TemplateId",
            count("Event"."TemplateId") AS template_count
           FROM public."Event"
          WHERE ("Event"."TemplateId" IS NOT NULL)
          GROUP BY "Event"."LevelId", "Event"."TemplateId"
        )
 SELECT template_at_level."TemplateId",
    count(template_at_level."TemplateId") AS "UsageCount"
   FROM template_at_level
  GROUP BY template_at_level."TemplateId"
  WITH NO DATA;

