INSERT INTO public."Localization" VALUES ('ONBOARDING_DATA_PRIVACY_DESC', 'Text', '', '{"eng":"<indent=0.75em>1. Ad ID is used to improve our marketing campaigns outside of Frever</indent>\n<indent=0.75em>2. If you wish to not provide us with the Ad ID, invitation links will not work and we will not be able to understand if you downloaded the app from a marketing campaign</indent>\n<indent=0.75em>3. Apart from the above, not sharing the Ad ID will not impact your experience in Frever</indent>","spa":"<indent=0.75em>1. El ID de anuncio se utiliza para mejorar nuestras campañas de marketing fuera de Frever.</indent>\n<indent=0.75em>2. Si prefieres no proporcionarnos el ID de anuncio, los enlaces de invitación no funcionarán y no podremos saber si descargaste la aplicación desde una campaña de marketing.</indent>\n<indent=0.75em>3. Además de lo anterior, si no compartes el ID de anuncio no afectará tu experiencia en Frever.</indent>","fra":"<indent=0.75em>1. L''identifiant publicitaire est utilisé pour améliorer nos campagnes marketing en dehors de Frever</indent>\n<indent=0.75em>2. Si vous ne souhaitez pas nous fournir votre identifiant publicitaire, les liens d''invitation ne fonctionneront pas et nous ne pourrons pas savoir si vous avez téléchargé l''application depuis une campagne marketing</indent>\n<indent=0.75em>3. En dehors de ce qui précède, le fait de ne pas partager votre identifiant publicitaire n''aura pas d''impact sur votre expérience dans Frever</indent>"}');
