INSERT INTO public."Localization" VALUES ('ACCOUNT_DELETE_DESC', 'Text', 'Profile page -> Settings -> Manage Account', '{"eng":"<size=127%><color=white>Notice</color></size>\n\n<margin=0.5em><indent=3%>- You won''t be able to login to Frever with your account.</indent>\n<indent=3%>- Your in-app purchases, if any, cannot be refunded.</indent>\n<indent=3%>- All personal data associated with your account will be deleted within 30 days.</indent>","spa":"<size=127%><color=white>Nota</color></size>\n\n<margin=0.5em><indent=3%>- No podrás iniciar sesión en Frever con tu cuenta.</indent>\n<indent=3%>- No se pueden reembolsar las compras dentro de la aplicación, si las hay.</indent>\n<indent=3%>- Todos los datos personales asociados con tu cuenta serán eliminados en un plazo de 30 días.</indent>","deu":"<size=127%><color=white>Hinweis</color></size>\nSie können sich nicht mehr bei Frever mit Ihrem Konto anmelden. Ihre In-App-Käufe können nicht erstattet werden, falls vorhanden. Alle persönlichen Daten, die mit Ihrem Konto verbunden sind, werden innerhalb von 30 Tagen gelöscht.","fra":"<size=127%><color=white>Avis</color></size>\n<margin=0.5em><indent=3%>- Vous ne pourrez pas vous connecter à Frever avec votre compte.</indent>\n<indent=3%>- Vos achats intégrés, le cas échéant, ne pourront pas être remboursés.</indent>\n<indent=3%>- Toutes les données personnelles associées à votre compte seront supprimées dans un délai de 30 jours.</indent>"}');
